I never considered myself someone who suffered with anxiety. This is because I never really understood what anxiety really was. When I spent some of my childhood crying uncontrollably at the thought of going to school because I had to take part in a project and I didn’t know what that entailed, anxiety hadn’t been defined... or at least not to me. The more I hear other’s talk about their anxiety, the more I am able to identify my own. Unfortunately my anxiety is sometimes a tool. It means both that I strive for absolute success and it pushes me to do better, but also that I can never enjoy success because it tells me that I need to repeat any success for it to truly count. So whilst my anxiety wants me not to post a selfie because it ‘doesn’t do as well as product pics’ I’m posting this one and taking a second to breathe and remember there are people out there that have far more to be anxious about than me! Today my anxiety can fuck off and I hope you can say the same to yours some days too. 💕⁣⁣
